var title_f35_62_36843="LTOT indications";
var content_f35_62_36843=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F76543&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F76543&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Indications for long-term oxygen therapy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        General indications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PaO",
"        <sub>",
"         2",
"        </sub>",
"        &le;55 mmHg (7.32 kPa) or SaO",
"        <sub>",
"         2",
"        </sub>",
"        &le;88 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        In the presence of cor pulmonale",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PaO",
"        <sub>",
"         2",
"        </sub>",
"        &le;59 mmHg (7.85 kPa) or SaO",
"        <sub>",
"         2",
"        </sub>",
"        &le;89 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        EKG evidence of P pulmonale",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hematocrit &gt;55 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clinical evidence of right heart failure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Specific situations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PaO",
"        <sub>",
"         2",
"        </sub>",
"        &ge;60 mmHg (7.98 kPa) or SaO",
"        <sub>",
"         2",
"        </sub>",
"        &ge;90 percent with lung disease and other clinical needs such as sleep apnea with nocturnal desaturation not corrected by CPAP.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If the patient meets criteria at rest, O",
"        <sub>",
"         2",
"        </sub>",
"        should also be prescribed during sleep and exercise, and appropriately titrated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If the patient is normoxemic at rest but desaturates during exercise (PaO",
"        <sub>",
"         2",
"        </sub>",
"        &le;55 mmHg [7.32 kPa]), O",
"        <sub>",
"         2",
"        </sub>",
"        is generally prescribed for use during exercise. For patients who desaturate (PaO",
"        <sub>",
"         2",
"        </sub>",
"        &le;55 mmHg [7.32 kPa]) during sleep, further evaluation with polysomnography may be indicated to assess for sleep-disordered breathing.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
