"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    The relationship between intracranial volume and pressure is nonlinear",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 445px; height: 282px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An initial increase in volume results in a small increase in pressure because of intracranial compensation (blue line). Once intracranial compensation is exhausted, additional increases in intracranial volume result in a dramatic rise in intracranial pressure (red line).",
